import  React, { Component } from "react"
import {ScreenLayouts} from "./FormLayouts"
import DVForms from "../DVComponents/DVForms";

type formId = {
    Id: string
}

export class FormBuilder extends React.Component<formId> {
    constructor(props){
        super(props);
    }
    render() {
      return (
            <div>
                <DVForms className={ "width: '100%', height: '300px', backgroundColor: '#fff !important'" } template={ScreenLayouts[this.props.Id]} value={ScreenLayouts["LoginScreenValue"]}></DVForms>
            </div>
        );
    }
  }
  export default FormBuilder;
